import CarListItems from "../mocks/Mocks";

function YearOrder() {
  return CarListItems.sort((a, b) => {
    if (a.year < b.year) {
      return 1;
    }
    if (a.year > b.year) {
      return -1;
    }
    return 0;
  });
}

export default YearOrder;
